import numpy as np
from numpy import linalg as LA

from discreteMarkovChain import markovChain
from kronprod import *


def fullKronProd(P,Q):
    PQ=np.zeros((len(P)*len(Q),len(P)*len(Q)))
    
    n=len(Q)
    for l in range(len(Q)):
        for k in range(len(Q)):
            for j in range (len(P)): 
                for i in range (len(P)):
                    PQ[k+n*l][i+n*j]=P.item((k, i))* Q.item((l, j)) 
    return PQ

# pass in list of nxn matrices
def hittingtime(Mlist):
    #Plist = [np.array(markovChain(m).getTransitionMatrix()) for m in Mlist]
    Plist = Mlist
    A = KronProd(Plist)

    ## Target states -- diagonal states of final Markov chain
    diagonaltargetset=[0]
    diag=1
    for i in range(1,A.N):
        if i==diag*(A.n[0])+diag:
            diagonaltargetset.append(i)
            diag=diag+1
    #print diagonaltargetset
    
    ## Target states
    hittingset=diagonaltargetset
    #hittingset=[0,3]

    one = np.ones(A.N)
    one[hittingset] = 0
    
    ##k1 = np.zeros(len(M))
    ##for i in range(100):
    ##    k1 = M3.dot(k1)+one1
    ##    k1[hittingset1]  = 0
    ##    #print k1
    ##
    ##print(k1)

    mask = np.zeros(A.N)
    for i in range(A.N):
        if i in hittingset:
            mask[i]=1

        
    k1 = np.zeros(A.N)
    k2 = one + A.dot(k1)
    i = 0

    while(LA.norm(k1-k2)>1e-6):
        k1=k2
        k2 = one + A.dot(k1)
        np.putmask(k2, mask, 0)
        i += 1
        print("Iteration",i)
        print(LA.norm(k1-k2))

    print('Hitting Time',k2)

    return k2

